import { Booklist } from "./components/Booklist";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

//Appが親、Booklistが子
const App = () => {
  const getDataFromAPI = (keyword) => {
    return `${keyword} books`;
  };
  const languages = ["React", "Vue", "Angular"];
  return (
    // <>
    //   <h1>react app</h1>
    //   <Booklist />
    //   <Booklist language={languages[0]} hoge={ 'hogehoge'}/>
    //   <Booklist language={languages[1]} />
    //   <Booklist language={languages[2]} />
    // </>
    <BrowserRouter>
      <h1>react app</h1>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li>
          <Link to="/react">React</Link>
        </li>
        <li>
          <Link to="/vue">Vue</Link>
        </li>
        <li>
          <Link to="/angular">Angular</Link>
        </li>
      </ul>
      <hr />
      <Routes>
        <Route
          path="/react"
          element={
            <Booklist language={languages[0]} getData={getDataFromAPI} />
          }
        />
        {/* <Route path="/react" element={<Booklist language={languages[0]} hoge={'hogehoge'}/>} /> */}
        <Route path="/vue" element={<Booklist language={languages[1]} getData={getDataFromAPI}/>} />
        <Route path="/angular" element={<Booklist language={languages[2]} etData={getDataFromAPI}/>} />
      </Routes>
    </BrowserRouter>
  );
};
export default App;
